args.functionCode:
async () => {
  // Arrancar Dev Client con deep link directo desde launchApp.
  // Desactivar sincronizacin nativa de Detox para evitar bloqueos de awaitIdle durante bootstrap.
  const bundleURL = process.env.EXPO_BUNDLE_URL || 'http://localhost:8081';
  const devClientURL = `exp+seguridadciudadanaapp://expo-development-client/?url=${encodeURIComponent(bundleURL)}`;
  await device.launchApp({
    newInstance: true,
    launchArgs: {
      detoxEnableSynchronization: 0
    },
    url: devClientURL
  });

  // Una vez cargado el bundle, forzar navegacin directa a Login mediante deep link de la app.
  // Pequeo delay para asegurar que el runtime est listo antes de openURL en Android.
  await new Promise(resolve => setTimeout(resolve, 2000));
  try {
    await device.openURL({
      url: 'exp+seguridadciudadanaapp://login'
    });
  } catch (e) {
    // Si falla el deep link explcito, continuar: la app debera respetar initialRouteName con DETOX_E2E.
  }
}

() => {
    if (config.resetModules) {
      runtime.resetModules();
    }
    if (config.clearMocks) {
      runtime.clearAllMocks();
    }
    if (config.resetMocks) {
      runtime.resetAllMocks();
      if (config.fakeTimers.enableGlobally && config.fakeTimers.legacyFakeTimers) {
        // during setup, this cannot be null (and it's fine to explode if it is)
        environment.fakeTimers.useFakeTimers();
      }
    }
    if (config.restoreMocks) {
      runtime.restoreAllMocks();
    }
  }

async () => {
    // En modo Detox, los campos se prellenan desde la app
    // Solo verificamos que el botn de login est visible y lo pulsamos
    await waitFor(element(by.id('login-submit'))).toBeVisible().withTimeout(12000);
    await element(by.id('login-submit')).tap();

    // Espera que el dashboard se muestre
    await waitFor(element(by.id('dashboard-authority'))).toBeVisible().withTimeout(10000);
  }

async () => {
  // No cleanup manual: el entorno Detox se encarga del cierre.
}

